// Online C++ compiler to run C++ program online
#include <iostream>

using namespace std;
long long int countSwaps(string s);

int main() {
    // Write C++ code here
    string s = ""; //1010011 -> 0100111 -> 0001111
    cout << countSwaps(s) << endl;
    return 0;
}

long long int countSwaps(string s){
    long long int count = 0;
    char temp {};
    int left = 0, right = s.size()-1;
    while(left < right){
        if((s[left] == '1') && (s[right] == '0')){
            temp = s[left];
            s[left] = s[right];
            s[right] = temp;
            count += right - left;
            left++;
            right--;
        }
        else if(s[right] == '1'){
            right--;
        }
        else if(s[left] == '0'){
            left++;
        }
        
    }
    cout << s << endl;
    return count;
}